import React from 'react';
import Joke from './components/Joke';

function App() {
  return (
    <div className="mx-auto max-w-screen-lg flex justify-center">
      <div className="w-1/3">
        <Joke setup="I few years ago i throw a bumerang" punchline="Now i live in constant fear" />
      </div>
      <div className="w-1/3">
        <Joke setup="I few years ago i throw a bumerang" punchline="Now i live in constant fear" />
      </div>
      <div className="w-1/3">
        <Joke setup="I few years ago i throw a bumerang" punchline="Now i live in constant fear" />
      </div>
      <div className="w-1/2">
        <Joke setup="I few years ago i throw a bumerang" punchline="Now i live in constant fear" />
      </div>
      <div className="w-1/2">
        <Joke setup="I few years ago i throw a bumerang" punchline="Now i live in constant fear" />
      </div>
    </div>
  );
}

export default App;
